import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import MissionAndValues from './components/MissionAndValues';
import InstitutionsSearch from './components/InstitutionsSearch';
import CampaignsHighlight from './components/CampaignsHighlight';
import RegistrationBanner from './components/RegistrationBanner';
import DonorRegistrationForm from './components/DonorRegistrationForm';
import InstitutionRegistrationForm from './components/InstitutionRegistrationForm';
import DonorProfile from './components/DonorProfile';
import InstitutionProfile from './components/InstitutionProfile';
import CreateCampaign from './components/CreateCampaign';
import Home from './pages/Home';
import OnlineDonation from './components/OnlineDonation'; // Importe o componente OnlineDonation

function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path="/" component={Home} />
        <Route path="/mission-and-values" component={MissionAndValues} />
        <Route path="/institutions-search" component={InstitutionsSearch} />
        <Route path="/campaigns-highlight" component={CampaignsHighlight} />
        <Route path="/registration-banner" component={RegistrationBanner} />
        <Route path="/donor-registration-form" component={DonorRegistrationForm} />
        <Route path="/institution-registration-form" component={InstitutionRegistrationForm} />
        <Route path="/donor-profile" component={DonorProfile} />
        <Route path="/institution-profile" component={InstitutionProfile} />
        <Route path="/create-campaign" component={CreateCampaign} />
        <Route path="/online-donation" component={OnlineDonation} /> {/* Adicione esta linha para criar a rota para OnlineDonation */}
      </Router>
    </div>
  );
}

export default App;
